import React, { useEffect, useState } from 'react';
import AdicionarContato from '../adicionarContato/addContact';
import logo from '../../assets/logo.png';
import addUser from '../../assets/icons/addUser.svg';
import searchUser from '../../assets/icons/search.svg'

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://my.api.mockaroo.com/users.json?key=7ce8e6d0');
        const data = await response.json();
        setUsers(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <main className='container'>
      <div className='listContact'>
        <h1>Lista de Usu√°rios</h1>
        <ul>
          {users.map(user => (
            <li key={user.id}>
              <p className='nameDetail'>{user.first_name} {user.last_name}</p>
              <img className='imageDetail' src={user.avatar} alt="Avatar" />
            </li>
          ))}
        </ul>
      </div>
    </main>
  );
}

export default App;
